import React, { Component } from "react";
import logo from "../Logo.png";
import { format } from "util";
import axios from 'axios'

class ConfirmPage extends Component {
    constructor(props) {
        super(props)

        const bgStyle = {
            backgroundImage: "url(appPorts/ConfirmPage.png)"
        }

        this.state = {
            backgroundImage: backgroundImage
        }
    }

    render() {
        return(
            <div
      class="phone-body"
      style={this.state.backgroundImage}
    >
      <div id="root"></div>
      <div>
        <table>
          <tr>
            <td>
              <h1>
                <a href="../index.html">
                  <img src="logo.png" alt="logo" width="50" height="50" />
                </a>
                G U N F L O W
              </h1>
            </td>
          </tr>
          <tr>
            <td>
              <form action="Approved.html">
                <input class="button" type="submit" value="Go to Next Page" />
              </form>
            </td>
          </tr>
          <tr>
            <td></td>
          </tr>
          <tr>
            <td></td>
          </tr>
        </table>
      </div>
    </div>
        )
    }
}

export default ConfirmPage
